    "2016-07-27T22:44:29.570208",nt"name": "source-apportionment-of-atmospheric-fine-particulate-matter-collected-at-the-seney-nationa",nt"isopen":
    false,nt"url": null,nt"notes": "The trends in secondary organic aerosol
    at a remote location are studied using atmospheric fine particulate matter samples
    collected at Seney National Wildlife Refuge (NWR) in Northern Michigan. Detailed
    organic analysis by gas chromatography-mass spectrometry (GC-MS) reveals tracers
    for primary anthropogenic emissions at low concentrations compared to relatively
    high levels of organic di- tri- and tetra-carboxylic acids thought to be indicators
    of secondary organic aerosols. Seasonal changes in these organic compounds are tracked
    using monthly composites. The concentration of aromatic and aliphatic dicarboxylic
    acids peak in July and taper off in the fall, which coincides with fine particle
    organic carbon concentration. In contrast, a chemical mass balance model used to
    quantify primary sources of particulate matter shows higher contributions from primary
    emissions in the winter. Complementing the monthly average concentrations, event-based
    composites of high volume samples were used to track the different species of secondary
    organic aerosols at the Seney NWR location. The distribution of aliphatic diacids
    and the aromatic di- and triacids varied across different atmospheric conditions,
    which suggests different precursor gases for these secondary organic aerosol components.
    The aliphatic diacid concentrations track with ambient concentrations of particle-phase
    pinonic acid. In addition, back trajectories for the 8 event-based composites are
    compared to the organic acid concentrations, and source regions were linked to the
    distribution of organic acid present in the composites.",nt"license_title":
